          "description": "If you are over 18 and want to take part in the international kurzgesagt meetup: Go to our temporary subreddit and look for your area or city, to find a Kurzgesagt meet up near you: \nhttps://kgs.link/kgs_meetup\nPlease note that this is an experiment, it is free and self organized by Kurzgesagt viewers like you. The subreddit will be open for 3 weeks and will be made private after. Thanks to everyone who helped us set this up!\n\nWe want to be part of your friendship journey, so we‚Äôve created a few things you can share with new and old friends: https://kgs.link/friendship_collection\n\nSources & further reading:\nhttps://sites.google.com/view/sources-friendship/\n\nFriends make life good. They provide the scaffolding that makes it not just bearable but fun. They give us a sense of meaning and purpose and are a source of security, self esteem and happiness. Almost nothing predicts how happy you will be as how connected you feel and a lack of social connection is associated with a number of diseases and a shorter life.\n\nBut maybe you have scrolled through your phone, unsure who to call to go to a movie with, to celebrate with or ask for comfort. You may realize that you don‚Äôt have enough friends and feel lonely. And it is not just you. Disconnectedness and loneliness are widespread. \n\nMany people want more close friends but don‚Äôt know how to get them.\n\n\nOUR CHANNELS\n‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ\nGerman:        https://kgs.link/youtubeDE\nSpanish:        https://kgs.link/youtubeES\nFrench:          https://kgs.link/youtubeFR\nPortuguese:  https://kgs.link/youtubePT\nArabic:           https://kgs.link/youtubeAR\nHindi:             https://kgs.link/youtubeHI\nJapanese:     https://kgs.link/youtubeJA\nKorean:          https://kgs.link/youtubeKO\n\n\nHOW CAN YOU SUPPORT US?\n‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ‚ñÄ\nThis is how we make our living